//___________LOAD FOOD INSECURITY TSV, COLOR COUNTIES BASED ON SECURITY RATE, READY FUNCTION___________//

// ready fuction, load food_insecurity.tsv
queue()
    .defer(d3.tsv, "food_insecurity.tsv")
    .await(ready);

function ready(error, insecure) {
 	if (error) return console.warn(error);

	//iterate through insecurity data
	insecure.forEach(function(d) {
	
	   	//force numbers to numbers, trim white space from county names
	    d.InsecurityRate =+d.InsecurityRate;
	    d.NumberInsecure =+d.NumberInsecure;
	    d.Below200Pov =+d.Below200Pov;
	    d.Above200Pov  =+d.Above200Pov;
	    d.County = $.trim(d.County);

		//match food insecurity data to county data, based on county names. Add insecurity data to counties geojson object
		for (var i in counties.features) {
			if (d.County == counties.features[i].properties.NAME) {
				counties.features[i].properties.InsecurityRate = d.InsecurityRate;
				counties.features[i].properties.NumberInsecure = d.NumberInsecure;
				counties.features[i].properties.Below200Pov = d.Below200Pov;
				counties.features[i].properties.Above200Pov = d.Above200Pov;
			}
		}
	});


	//go through counties and color based on food insecurity rate
	countyLayer.forEach(function(d) {
		
		var featureInsecurityR = d.getProperty("InsecurityRate");

		if (featureInsecurityR < 0.1) {
		countyLayer.overrideStyle(d,{
	      fillColor: "#edf8fb"
	    })}
	    else if (featureInsecurityR >= 0.1 && featureInsecurityR < 0.12) {
			countyLayer.overrideStyle(d,{
	      fillColor: "#b2e2e2"
	    })}
	    else if (featureInsecurityR >= 0.12 && featureInsecurityR < 0.13) {
			countyLayer.overrideStyle(d,{
	      fillColor: "#66c2a4"
	    })}
	    else {
		   countyLayer.overrideStyle(d,{
	      fillColor: "#238b45"
	    })}
	});


}


